body:
As information for future people encountering this problem, I was finally able to move past this challenge by converting my .MP4 file into a .MOV file. I am unsure why .mp4 is not working with the analyze_videos function for me, but I used this code to make a conversion:

`!ffmpeg -i 12Feb2021-SAPAP3-264-1.MP4 -vcodec copy -acodec copy 12Feb2021-SAPAP3-264-1.MOV`

@backyardbiomech If you are aware of why I might need to convert to .MOV files, then your advice would be helpful, but otherwise I will proceed with converting all of my files to .MOV using this code. Thanks for your help.
